import React from "react";
import './sidebar.css'

export default function Sidebar() {
  return (
    <aside class="navbar navbar-side">
    <nav>
      <ul>
        <li><a href="#">Tableau de bord</a></li>
        <li><a href="#">Profil</a></li>
        <li><a href="#">Paramètres</a></li>
        <li><a href="#">Déconnexion</a></li>
      </ul>
    </nav>
  </aside>
  );
}
